import React, { useEffect, useState } from "react";
import "./admin.css"
import axios from 'axios';





const Admin = () => {

    const [data,setdata] = useState([]);
    const [book,setbook] = useState([]);
    const [plan,setplan] = useState([]);

    useEffect(()=>{
        axios.get("http://localhost:1000/servicebookget").then(function(response){
            setbook(response.data.data)
        })
        axios.get("http://localhost:1000/inquiryget").then(function(response){
            setdata(response.data.data)
        })
        axios.get("http://localhost:1000/serviceplanget").then(function(response){
            pl(response.data.data)
        })
    })

    return(
        <>
        <div className="admin-outer">
            <div className="admin-inner">
                <div className="admin-inner-child">
                    <ul>
                        <li>inquires</li>
                        <li>book services</li>
                        <li>plan book</li>
                    </ul>
                </div>
                <div className="admin-inner-child">
                    <div className="inquires">
                        <table>
                            <tr>
                                <td>id</td>
                                <td>name</td>
                                <td>email</td>
                                <td>number</td>
                                <td>action</td>
                            </tr>
                            {
                                data.map((e)=>{
                                    return(
                                        <>
                                            <tr>
                                                <td>{e.id}</td>
                                                <td>{e.name}</td>
                                                <td>{e.email}</td>
                                                <td>{e.number}</td>
                                                <td><button>
                                                    details</button></td>
                                            </tr>
                                        </>
                                    )
                                })
                            }
                        </table>
                    </div>
                    <div className="book-services">
                        <table>
                            <tr>
                                <td>id</td>
                                <td>name</td>
                                <td>email</td>
                                <td>number</td>
                                <td>action</td>
                            </tr>
                            {
                                book.map((e)=>{
                                    return(
                                        <>
                                            <tr>
                                                <td>{e.id}</td>
                                                <td>{e.name}</td>
                                                <td>{e.email}</td>
                                                <td>{e.number}</td>
                                                <td><button>
                                                    details</button></td>
                                            </tr>
                                        </>
                                    )
                                })
                            }
                        </table>
                    </div>
                    <div className="plan-book">
                        <table>
                            <tr>
                                <td>id</td>
                                <td>name</td>
                                <td>email</td>
                                <td>number</td>
                                <td>action</td>
                            </tr>
                            {
                                plan.map((e)=>{
                                    return(
                                        <>
                                            <tr>
                                                <td>{e.id}</td>
                                                <td>{e.name}</td>
                                                <td>{e.email}</td>
                                                <td>{e.number}</td>
                                                <td><button>
                                                    details</button></td>
                                            </tr>
                                        </>
                                    )
                                })
                            }
                        </table>
                    </div>
                </div>
            </div>
        </div>
        </>
    )
}



export default Admin;
